import React from 'react'

const Kontakt = props => {

	// geiler Effekt:
	// backdropFilter: blur(10px) 
	
	const style = {
		section: {},
		heading: {
			margin:0,
    		padding: 10,
    		display: "inline-block",
    		background: 'rgb(240,240,240)',
    		color: 'rgb(120,120,120)',
    		position: 'initial',
    		zIndex: 4,
    		pointerEvents: 'none'
		},
		kontaktList: {

		}
	}

	return (		
		<div className="sctn sctn_kontakt" style={style.section}>
		<div className="sctn_subheading">
			<span className="sctn_heading delayed-fallable" style={style.heading}>Ich</span><span className="sctn_heading delayed-fallable" style={style.heading}>freue</span><span className="sctn_heading delayed-fallable" style={style.heading}>mich</span><span className="sctn_heading delayed-fallable" style={style.heading}>Ã¼ber</span><span className="sctn_heading delayed-fallable" style={style.heading}>Nachrichten</span><span className="sctn_heading delayed-fallable" style={style.heading}>!!</span>
		</div>
			<div className="sctn_body" style={style.sectionBody}>
				<ul className="kontakt_list" style={style.kontaktList}>
				</ul>
			</div>
		</div>
	)
}

export default Kontakt
